import React,{Component} from 'react';
import './Signin.css'


export default class Signin extends Component {
  render() {
    return (
      
      <div id="wrapper">
        <form id="login">
        <h2>Login or signup:</h2>
        <div id="firebaseui-auth-container"></div>
        </form>
      </div>
      // <div id="firebaseui-auth-container"></div>
    
    );
  }
}
